B.acg=new A.bd("-Nella fase a girone non esistono pareggi. Finiti i tempi regolamentari (25 minuti a tempo), in caso di pareggio, si decider\xe0 tutto ai calci di rigore ",null,null,null,null,null,B.W,null,null,null)
B.abJ=new A.bd("-La vittoria nei tempi regolamentari vale 3 punti e la sconfitta 0. Arrivati ai calci di rigore si assegneranno 2 punti ai vincitori e 1 punto ai perdenti",null,null,null,null,null,B.W,null,null,null)
B.aci=new A.bd("-Non esistono sostituzioni. I 7 giocatori che scendono in campo saranno gli stessi che finiranno la partita",null,null,null,null,null,B.W,null,null,null)
B.abU=new A.bd("-La quota di partecipazione sar\xe0 di 20\u20ac. Compresa nel prezzo dell'iscrizione ci sar\xe0 anche la maglia ufficiale del torneo che obbligatoriamente deve essere messa ogni partita",null,null,null,null,null,B.W,null,null,null)
B.abM=new A.bd("-Non saranno tollerati in alcun modo eccessi di foga o insulti pena espulsione diretta (3 minuti fuori dal campo)",null,null,null,null,null,B.W,null,null,null)
B.acj=new A.bd("-In caso uno o pi\xf9 giocatori dei 7 che si sono iscritti inizialmente non possono partecipare ad una partita, deve essere comunicato il cambio al massimo 24 ore prima dell'inizio del match",null,null,null,null,null,B.W,null,null,null)
B.acc=new A.bd("-Oltre ai trofei per 1\xb0, 2\xb0 e 3\xb0 posto verranno assegnati al capocannoniere e all'MVP del torneo due trofei personali ",null,null,null,null,null,B.W,null,null,null)
B.abZ=new A.bd("-Saranno riscossi 50\u20ac da ogni squadra a inizio torneo per la cauzione. Nel caso non ci sia nessun problema nel corso del torneo verranno restituiti al termine",null,null,null,null,null,B.W,null,null,null)
B.ac4=new A.bd("-Il calendario stilato pu\xf2 essere cambiato ma con grande preavviso",null,null,null,null,null,B.W,null,null,null)
B.ac1=new A.bd("-Prima di ogni partita, il capitano raccoglie le quote (42\u20ac a squadra) e le consegna agli organizzatori. Le quote comprenderanno il pagamento del campo e il pagamento dell'arbitro",null,null,null,null,null,B.W,null,null,null)
